#include "../matrix_lib/matrix_lib.h"
#include <gtest/gtest.h>

TEST(TestMulScal, basic) {
    matrix_lib::Matrix left;
    int right;
    matrix_lib::Matrix result;

    left = matrix_lib::Matrix{{-5,  -24},
                              {-35, 35}};
    right = -1;
    result = matrix_lib::Matrix{{5,  24},
                                {35, -35}};
    EXPECT_EQ(left * right, result);

    left = matrix_lib::Matrix{{36,  -44},
                              {-11, -43}};
    right = -30;
    result = matrix_lib::Matrix{{-1080, 1320},
                                {330,   1290}};
    EXPECT_EQ(left * right, result);

    left = matrix_lib::Matrix{{20, 16},
                              {40, 9}};
    right = -19;
    result = matrix_lib::Matrix{{-380, -304},
                                {-760, -171}};
    EXPECT_EQ(left * right, result);

    left = matrix_lib::Matrix{{-46, -46},
                              {-49, 21}};
    right = 48;
    result = matrix_lib::Matrix{{-2208, -2208},
                                {-2352, 1008}};
    EXPECT_EQ(left * right, result);

    left = matrix_lib::Matrix{{21,  3},
                              {-28, -12}};
    right = 24;
    result = matrix_lib::Matrix{{504,  72},
                                {-672, -288}};
    EXPECT_EQ(left * right, result);

    left = matrix_lib::Matrix{{17, -18},
                              {7,  20}};
    right = 26;
    result = matrix_lib::Matrix{{442, -468},
                                {182, 520}};
    EXPECT_EQ(left * right, result);

    left = matrix_lib::Matrix{{8, 14},
                              {7, 11}};
    right = -21;
    result = matrix_lib::Matrix{{-168, -294},
                                {-147, -231}};
    EXPECT_EQ(left * right, result);

    left = matrix_lib::Matrix{{-49, -49},
                              {45,  7}};
    right = 17;
    result = matrix_lib::Matrix{{-833, -833},
                                {765,  119}};
    EXPECT_EQ(left * right, result);

    left = matrix_lib::Matrix{{46,  -36},
                              {-31, -37}};
    right = -44;
    result = matrix_lib::Matrix{{-2024, 1584},
                                {1364,  1628}};
    EXPECT_EQ(left * right, result);

    left = matrix_lib::Matrix{{-24, 9},
                              {20,  25}};
    right = -3;
    result = matrix_lib::Matrix{{72,  -27},
                                {-60, -75}};
    EXPECT_EQ(left * right, result);
}

